import React, { useState } from "react";
import emailjs from "emailjs-com";

const Contact = () => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    feedback: "",
  });

  const [message, setMessage] = useState("");

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    emailjs
      .send(
        "YOUR_SERVICE_ID", // Replace with your EmailJS service ID
        "YOUR_TEMPLATE_ID", // Replace with your EmailJS template ID
        {
          name: formData.name,
          email: formData.email,
          feedback: formData.feedback,
        },
        "YOUR_PUBLIC_KEY" // Replace with your EmailJS public key
      )
      .then(
        (response) => {
          setMessage("Feedback submitted successfully!");
          setFormData({ name: "", email: "", feedback: "" });
        },
        (error) => {
          setMessage("An error occurred. Please try again.");
          console.error("EmailJS Error:", error);
        }
      );
  };

  return (
    <div style={{ padding: "40px", fontFamily: "Roboto", backgroundColor: "#f7f7f7" }}>
      {/* Location Section */}
      <div
        style={{
          padding: "20px",
          backgroundColor: "#00004d",
          color: "white",
          borderRadius: "10px",
          marginBottom: "20px",
        }}
      >
        <h2 style={{ margin: "0" }}>Location</h2>
        <p style={{ margin: "5px 0 0 0" }}>
          Vasavi College of Engineering, Hyderabad, India
        </p>
      </div>

      {/* Feedback Form Section */}
      <div
        style={{
          padding: "20px",
          backgroundColor: "#ffffff",
          boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
          borderRadius: "10px",
        }}
      >
        <h2 style={{ marginBottom: "20px", color: "#00004d" }}>Feedback Form</h2>
        <form onSubmit={handleSubmit}>
          {/* Name Input */}
          <div style={{ marginBottom: "15px" }}>
            <label htmlFor="name" style={{ fontSize: "16px", fontWeight: "bold" }}>
              Name:
            </label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
              style={{
                width: "100%",
                padding: "10px",
                border: "1px solid #ddd",
                borderRadius: "5px",
                marginTop: "5px",
              }}
            />
          </div>

          {/* Email Input */}
          <div style={{ marginBottom: "15px" }}>
            <label htmlFor="email" style={{ fontSize: "16px", fontWeight: "bold" }}>
              Email:
            </label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
              style={{
                width: "100%",
                padding: "10px",
                border: "1px solid #ddd",
                borderRadius: "5px",
                marginTop: "5px",
              }}
            />
          </div>

          {/* Feedback Input */}
          <div style={{ marginBottom: "20px" }}>
            <label htmlFor="feedback" style={{ fontSize: "16px", fontWeight: "bold" }}>
              Feedback:
            </label>
            <textarea
              id="feedback"
              name="feedback"
              value={formData.feedback}
              onChange={handleChange}
              required
              style={{
                width: "100%",
                padding: "10px",
                border: "1px solid #ddd",
                borderRadius: "5px",
                marginTop: "5px",
                height: "100px",
              }}
            ></textarea>
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            style={{
              padding: "10px 20px",
              backgroundColor: "#00004d",
              color: "white",
              border: "none",
              borderRadius: "5px",
              cursor: "pointer",
              fontSize: "16px",
            }}
          >
            Submit
          </button>
        </form>

        {/* Feedback Message */}
        {message && (
          <p style={{ marginTop: "20px", color: message.includes("success") ? "green" : "red" }}>
            {message}
          </p>
        )}
      </div>
    </div>
  );
};

export default Contact;
